import React from 'react'
import '../styles/regions.css';
import { Link } from 'react-router-dom';
import Malakand from './Malakand';
export default function Regions() {
  return (
    <div className='regionscontainer'>
      <h3>Select Any Region:</h3>
      <select >
        <option value={'option1'}><Link to='/south'><span>South</span></Link></option>
        <option value={'option2'}><Link to='/malakand'>Malakand</Link></option>
        <option value={'option3'}><Link to='/hazara'>Hazara</Link></option>
        <option value={'option4'}><Link to='/watershed'>Watershed</Link></option>
      </select>
      <Malakand/>
    </div>
  )
}
